var msg = new Object();

msg.num = 0;
msg.type = 0;
msg.delay = 5000;
msg.flowDiv = null;
msg.limDiv = null;
msg.posPixel = [1280, 50, 20, 0, 10, 2, 5];
msg.base64Src = 'data:image/png;base64,';
msg.base64SrcArr = [
	'data:image/png;base64,',
	'data:image/png;base64,',
	'data:image/png;base64,',
	'data:image/png;base64,'
];

msg.createMsgArea = function(obj){
	if(!msg.flowDiv && !msg.limDiv){
		msg.flowDiv = document.createElement('div');
		msg.flowDiv.id = 'msgDiv';
		msg.flowDiv.style.cssText = 'position:absolute;width:' + (msg.posPixel[0] - msg.posPixel[2]) + 'px;height:' + (msg.posPixel[1] * 5) + 'px;left:' + msg.posPixel[3] + 'px;top:' + (msg.posPixel[1] * 9) + 'px;overflow:hidden';
		obj.appendChild(msg.flowDiv);
		msg.limDiv = document.createElement('div');
		msg.limDiv.id = 'limDiv';
		msg.limDiv.style.cssText = 'position:absolute;width:' + (msg.posPixel[0] - msg.posPixel[2]) + 'px;height:' + msg.posPixel[3] + 'px;left:' + msg.posPixel[3] + 'px;top:' + (msg.posPixel[1] * 5) + 'px';
		msg.limDiv.style.height = ((msg.num + 1) * msg.posPixel[1]) + 'px';
		msg.flowDiv.appendChild(msg.limDiv);
	}
};

msg.sendMsg = function(str){
	var strDiv = document.createElement('div');
	strDiv.style.cssText = 'position:absolute;border-radius:' + msg.posPixel[4] + 'px;opacity:1;filter:alpha(opacity=100);color:#FFFFFF;z-index:9999';
	strDiv.style.background = 'url(' + (msg.type == 0 ? msg.base64Src : msg.base64SrcArr[msg.num % msg.base64SrcArr.length]) + ') no-repeat';
	strDiv.style.backgroundSize = '100%';
	strDiv.innerText = str;
	msg.limDiv.appendChild(strDiv);
	strDiv.style.textAlign = 'center';
	strDiv.style.fontSize = msg.posPixel[2] + 'px';
	strDiv.style.lineHeight = (msg.posPixel[1] - msg.posPixel[5]) + 'px';
	strDiv.style.height = (msg.posPixel[1] - msg.posPixel[5]) + 'px';
	strDiv.style.width = (strDiv.offsetWidth + msg.posPixel[2] * 2) + 'px';
	strDiv.style.left = (msg.posPixel[0] - (strDiv.offsetWidth + msg.posPixel[2] * 2)) + 'px';
	strDiv.style.top = (msg.num * msg.posPixel[1]) + 'px';
	strDiv.style.verticalAlign = 'middle';
	msg.moveUp(msg.limDiv, msg.limDiv.offsetTop - msg.posPixel[1], msg.posPixel[6]);
	msg.fadeIn(strDiv);
	setTimeout(function() {
		msg.fadeOut(strDiv);
	}, msg.delay);
	msg.num++;
};

msg.sendMsgWithWX = function(str, base){
	var strDiv = document.createElement('div');
	strDiv.style.cssText = 'position:absolute;border-radius:' + msg.posPixel[4] + 'px;opacity:1;filter:alpha(opacity=100);color:#FFFFFF;z-index:9999';
	strDiv.style.background = 'url(' + (msg.type == 0 ? msg.base64Src : msg.base64SrcArr[msg.num % msg.base64SrcArr.length]) + ') no-repeat';
	strDiv.style.backgroundSize = '100%';
	var imgDiv = document.createElement('img');
	imgDiv.src = base;
	imgDiv.style.width = (msg.posPixel[2] + msg.posPixel[4]) + 'px';
	imgDiv.style.height = (msg.posPixel[2] + msg.posPixel[4]) + 'px';
	imgDiv.style.borderRadius = '50%';
	imgDiv.style.marginTop = Math.floor((msg.posPixel[1] - msg.posPixel[5] - (msg.posPixel[2] + msg.posPixel[4])) / 2) + 'px';
	var txtDiv = document.createElement('span');
	txtDiv.innerText = str;
	txtDiv.style.marginLeft = msg.posPixel[4] + 'px';
	txtDiv.style.verticalAlign = 'top';
	strDiv.appendChild(imgDiv);
	strDiv.appendChild(txtDiv);
	msg.limDiv.appendChild(strDiv);
	strDiv.style.textAlign = 'center';
	strDiv.style.fontSize = msg.posPixel[2] + 'px';
	strDiv.style.lineHeight = (msg.posPixel[1] - msg.posPixel[5]) + 'px';
	strDiv.style.height = (msg.posPixel[1] - msg.posPixel[5]) + 'px';
	strDiv.style.width = (strDiv.offsetWidth + msg.posPixel[2] * 2) + 'px';
	strDiv.style.left = (msg.posPixel[0] - (strDiv.offsetWidth + msg.posPixel[2] * 2)) + 'px';
	strDiv.style.top = (msg.num * msg.posPixel[1]) + 'px';
	msg.moveUp(msg.limDiv, msg.limDiv.offsetTop - msg.posPixel[1], msg.posPixel[6]);
	msg.fadeIn(strDiv);
	setTimeout(function() {
		msg.fadeOut(strDiv);
	}, msg.delay);
	msg.num++;
};

msg.moveUp = function(obj, target, speed){
	clearInterval(obj.timer);
	obj.timer = setInterval(function(){
		var step = (target - obj.offsetTop) / 10;
		step = step > 0 ? Math.ceil(step) : Math.floor(step);
		obj.style.top = obj.offsetTop + step + 'px';
		if(Math.abs(target - obj.offsetTop) <= Math.abs(step)){
			obj.style.top = target + 'px';
			clearInterval(obj.timer);
		}
	}, speed);
};

msg.setOpacity = function(obj, level){
	if(obj.filters){ 
		obj.style.filter = 'alpha(opacity=' + level + ')';
	} else{ 
		obj.style.opacity = level / 100;
	}
};

msg.fadeIn = function(obj){
	msg.setOpacity(obj, 0);
	for(var i = 0; i <= 20; i++){
		(function(){
			var level = i * 5;
				setTimeout(function(){
					msg.setOpacity(obj, level);
				}, i * 50);
		})(i);
	}
};

msg.fadeOut = function(obj){
	for(var i = 0; i <= 20; i++){
		(function(){
			var level = 100 - i * 5;
			setTimeout(function(){
				msg.setOpacity(obj, level);
			}, i * 50);
		})(i);
	}
};